import './App.css';

import React, { Component } from 'react';

export class App extends Component {
  state = {videos:[]}
  componentDidMount() {
    fetch('/getvideos')
      .then(res => res.json())
      .then(videos => this.setState({ videos }));
  }
  render() {
    return (
      <div>
        <h1>{this.state.videos}</h1>
      </div>
    )
  }
}

export default App;
